<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8" />
    <meta name="viewport" content="initial-scale=1, width=device-width" />

    <link rel="stylesheet" href="./global.css" />
    <link rel="stylesheet" href="./d-l.css" />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Roboto Slab:wght@700;800&display=swap"
    />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Roboto:wght@400&display=swap"
    />
  </head>
  <body>
    <div class="dl">
      <div class="frame-parent5">
        <div class="rectangle-parent9">
          <img
            class="frame-child16"
            alt=""
            src="./public/rectangle-186@2x.png"
          />

          <div class="rectangle-parent10">
            <img
              class="frame-child17"
              alt=""
              src="./public/rectangle-196@2x.png"
            />

            <img
              class="frame-child18"
              loading="lazy"
              alt=""
              src="./public/rectangle-206@2x.png"
            />
          </div>
        </div>
        <header class="navbar9">
          <img class="lh-icon8" alt="" src="./public/lh@2x.png" />

          <div class="back-wrapper5">
            <img
              class="back-icon7"
              id="backIcon"
              loading="lazy"
              alt=""
              src="./public/back.svg"
            />
          </div>
        </header>
      </div>
      <section class="footer8">
        <div class="logo-ini-merupakan">
          Logo ini merupakan pesanan dari Organisasi Bulutangkis. Organisasi ini
          menginginkan angka 8 dan 9 digabung menjadi sebuah lambang infinite.
          Karena anggota dari organisasi ini beranggotakan angkatan 8 dan 9 dari
          sebuah salah satu sekolah yang diikuti oleh organisasi tersebut.
        </div>
      </section>
    </div>
    <script>
      var backIcon = document.getElementById("backIcon");
      if (backIcon) {
        backIcon.addEventListener("click", function (e) {
          window.history.back();
        });
      }
    </script>
  </body>
</html>
